"use strict";(self.webpackChunktechfolios=self.webpackChunktechfolios||[]).push([[1477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"techfolio-designer","metadata":{"permalink":"/blog/techfolio-designer","source":"@site/blog/2018-08-01-techfolio-designer.md","title":"Techfolio Designer","description":"Techfolio Designer has not been updated to work with Techfolios Version 2","date":"2018-08-01T00:00:00.000Z","formattedDate":"August 1, 2018","tags":[{"label":"release","permalink":"/blog/tags/release"}],"readingTime":0.45,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"techfolio-designer","title":"Techfolio Designer","authors":"johnson","tags":["release"]},"nextItem":{"title":"Syntax highlighting fix","permalink":"/blog/syntax-highlighting-fix"}},"content":":::warning \\nTechfolio Designer has not been updated to work with Techfolios Version 2\\n:::\\n\\nWe are delighted to announce the initial release of TechFolio Designer: a cross-platform, desktop application designed exclusively for the development of TechFolio professional portfolios.\\n\\nIf you have problems, questions, or want to get involved, please contact Philip Johnson (johnson@hawaii.edu).\\n\\nIf you are a student at the University of Hawaii and want to get course credits during Fall of 2018 to work (in part) on TechFolio Designer, please check out the [ICS 491, Fall 2018 Class Description](http://philipmjohnson.org/ics491f18/)."},{"id":"syntax-highlighting-fix","metadata":{"permalink":"/blog/syntax-highlighting-fix","source":"@site/blog/2017-12-03-syntax-highlighting-fixed.md","title":"Syntax highlighting fix","description":"There has been a longstanding bug in Techfolios which prevented fenced code blocks from being highlighted.","date":"2017-12-03T00:00:00.000Z","formattedDate":"December 3, 2017","tags":[{"label":"bug","permalink":"/blog/tags/bug"}],"readingTime":0.35,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"syntax-highlighting-fix","title":"Syntax highlighting fix","authors":"johnson","tags":["bug"]},"prevItem":{"title":"Techfolio Designer","permalink":"/blog/techfolio-designer"},"nextItem":{"title":"TechFolio Workshops","permalink":"/blog/workshops-2016"}},"content":"There has been a longstanding bug in Techfolios which prevented [fenced code blocks](https://help.github.com/articles/creating-and-highlighting-code-blocks/) from being highlighted.\\n\\nWe finally figured out the problem: Techfolios need to load a rouge style file, and they weren\'t. With today\'s commit, the Techfolio header will load a rouge style sheet from the css/rouge directory.  There are a selection of rouge style files stored in there; you can change the default selected file by editing _config.yml."},{"id":"workshops-2016","metadata":{"permalink":"/blog/workshops-2016","source":"@site/blog/2016-10-11-workshops.md","title":"TechFolio Workshops","description":"The Department of Information and Computer Sciences is delighted to announce a three part workshop on developing a professional portfolio. These workshops will be held on Wednesday, November 2, 9, and 16, from 430pm.","date":"2016-10-11T00:00:00.000Z","formattedDate":"October 11, 2016","tags":[{"label":"workshop","permalink":"/blog/tags/workshop"}],"readingTime":0.18,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"workshops-2016","title":"TechFolio Workshops","authors":"johnson","tags":["workshop"]},"prevItem":{"title":"Syntax highlighting fix","permalink":"/blog/syntax-highlighting-fix"},"nextItem":{"title":"Release 1.1","permalink":"/blog/release-1-1"}},"content":"The Department of Information and Computer Sciences is delighted to announce a three part workshop on developing a professional portfolio. These workshops will be held on Wednesday, November 2, 9, and 16, from 4:30 to 5:30pm."},{"id":"release-1-1","metadata":{"permalink":"/blog/release-1-1","source":"@site/blog/2016-10-10-release.md","title":"Release 1.1","description":"Release 1.1 of TechFolio is now available. Enhancements include:","date":"2016-10-10T00:00:00.000Z","formattedDate":"October 10, 2016","tags":[{"label":"release","permalink":"/blog/tags/release"}],"readingTime":0.19,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"release-1-1","title":"Release 1.1","authors":"johnson","tags":["release"]},"prevItem":{"title":"TechFolio Workshops","permalink":"/blog/workshops-2016"},"nextItem":{"title":"ICS Portfolios","permalink":"/blog/ics-portfolios"}},"content":"Release 1.1 of TechFolio is now available. Enhancements include:\\n\\n  * Semantic UI updated from 2.2.2 to 2.2.4.  Among other things, this means more icons (such as GitLab).\\n  * Your email address now appears on your resume page (bio-network-links.html)."},{"id":"ics-portfolios","metadata":{"permalink":"/blog/ics-portfolios","source":"@site/blog/2016-10-01-ics-portfolios.md","title":"ICS Portfolios","description":"The TechFolio team is happy to announce the initial release of ICS Portfolios, a site providing a portal to dozens of TechFolios created by students and faculty in the Department of Information and Computer Science at the University of Hawaii.","date":"2016-10-01T00:00:00.000Z","formattedDate":"October 1, 2016","tags":[{"label":"release","permalink":"/blog/tags/release"}],"readingTime":0.48,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"ics-portfolios","title":"ICS Portfolios","authors":"johnson","tags":["release"]},"prevItem":{"title":"Release 1.1","permalink":"/blog/release-1-1"},"nextItem":{"title":"Techfolios at FullStack Honolulu","permalink":"/blog/fullstack-presentation"}},"content":"The TechFolio team is happy to announce the initial release of [ICS Portfolios](https://ics-portfolios.github.io), a site providing a portal to dozens of TechFolios created by students and faculty in the [Department of Information and Computer Science](http://www.ics.hawaii.edu) at the [University of Hawaii](http://www.hawaii.edu).\\n\\nICS Portfolios leverages the use of JSON Resume format to build a directory of the ICS community with a summary of each member along with a link to their professional portfolios for details. \\n\\nIf you are a member of the ICS community (student, faculty, or alumni) and would like to be included, please let us know."},{"id":"fullstack-presentation","metadata":{"permalink":"/blog/fullstack-presentation","source":"@site/blog/2016-09-15-fullstack.md","title":"Techfolios at FullStack Honolulu","description":"TechFolios will be presented at the inaugural meeting of FullStack Honolulu on October 6, 2016. See the Facebook Event Page for details on the event time and place.","date":"2016-09-15T00:00:00.000Z","formattedDate":"September 15, 2016","tags":[{"label":"presentation","permalink":"/blog/tags/presentation"}],"readingTime":0.14,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"fullstack-presentation","title":"Techfolios at FullStack Honolulu","authors":"johnson","tags":["presentation"]},"prevItem":{"title":"ICS Portfolios","permalink":"/blog/ics-portfolios"},"nextItem":{"title":"Initial Release","permalink":"/blog/initial-release"}},"content":"TechFolios will be presented at the inaugural meeting of [FullStack Honolulu](http://fullstack.org/) on October 6, 2016. See the [Facebook Event Page](https://www.facebook.com/events/213687262381371) for details on the event time and place."},{"id":"initial-release","metadata":{"permalink":"/blog/initial-release","source":"@site/blog/2016-08-10-initial-release.md","title":"Initial Release","description":"After review and lots of minor bug fixes, the TechFolio team is delighted to announce release 1.0 of TechFolio.","date":"2016-08-10T00:00:00.000Z","formattedDate":"August 10, 2016","tags":[{"label":"release","permalink":"/blog/tags/release"}],"readingTime":0.095,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"initial-release","title":"Initial Release","authors":"johnson","tags":["release"]},"prevItem":{"title":"Techfolios at FullStack Honolulu","permalink":"/blog/fullstack-presentation"},"nextItem":{"title":"Preview Release","permalink":"/blog/preview-release"}},"content":"After review and lots of minor bug fixes, the TechFolio team is delighted to announce release 1.0 of TechFolio."},{"id":"preview-release","metadata":{"permalink":"/blog/preview-release","source":"@site/blog/2016-06-15-techfolios-preview-release.md","title":"Preview Release","description":"After just two weeks of development, the TechFolio team is delighted to announce a preview release. Please take a look and let us know what you think.","date":"2016-06-15T00:00:00.000Z","formattedDate":"June 15, 2016","tags":[{"label":"release","permalink":"/blog/tags/release"}],"readingTime":0.135,"truncated":false,"authors":[{"name":"Philip Johnson","title":"Professor, University of Hawaii","url":"https://philipmjohnson.org","imageURL":"https://github.com/philipmjohnson.png","key":"johnson"}],"frontMatter":{"slug":"preview-release","title":"Preview Release","authors":"johnson","tags":["release"]},"prevItem":{"title":"Initial Release","permalink":"/blog/initial-release"}},"content":"After just two weeks of development, the TechFolio team is delighted to announce a preview release. Please take a look and let us know what you think."}]}')}}]);